import "./TransactionsContainer.css";
const TransactionsContainer = () => {
  return (
    <div className="frame-parent24">
      <div className="transactions-wrapper">
        <div className="transactions6">Transactions</div>
      </div>
      <div className="frame-parent25">
        <div className="all-transactions-parent1">
          <div className="all-transactions5">All Transactions</div>
          <div className="frame-child220" />
        </div>
        <div className="debit-parent1">
          <div className="debit8">Debit</div>
          <div className="frame-child221" />
        </div>
        <div className="credit-parent1">
          <div className="credit7">Credit</div>
          <div className="frame-child222" />
        </div>
      </div>
    </div>
  );
};

export default TransactionsContainer;
